import React from "react";

export default function HeroSection() {
  return (
    <section className="hero-section">
      <div className="hero-section-img">
        <div className="hero-section-items">
          <h1 className="hero-section-topic">
            Find Your Perfect Dream Home Today!
          </h1>
          <p className="under-topic">
            Explore the best properties for rent and sale in your area. Fast,
            reliable, and secure.
          </p>
          <button className="primary-btn bigger-primary-btn">Search Now</button>
        </div>
      </div>
    </section>
  );
}
